import React, { Component } from 'react';
import styled from 'styled-components'
import Navbar from './Navbar'


const BG = styled.div`
background-color: #f8bc00;
font-family: 'Athiti', sans-serif;
`

class App extends Component {
  render() {
    return (
      <div>
        <BG>
          <Navbar/>
            okjoko
        </BG>
      </div>
        );
      }
    }
export default App
